script: |
  super -f text -I q5893.spq | sort > q5893.out

inputs:
  - name: q5893.spq
    data: |
      SELECT - col2 / + ( + ( + + col0 ) ) + col1 + col0 col1, ( - 74 ) AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q5893.out
    data: |
      138	-74
      64	-74
      90	-74
